import React from "react";
import Header from "../components/Header";

const About = (props) => {
  return (
    <div className="header">
      <div className="breadcrumb">
        <Header/>
      </div>
      <p className="page">I have no information about myself. I promise it's just books but I am a secret lover of the Web Application Hackers Handbook.</p>
    </div>
  );
};

export default About;
